/**
 * @fileoverview Centralized Configuration Manager
 * Manages global settings, environment variables, timeouts, and LLM configs.
 * 
 * @module api/core/config
 */

import { getSettings as getRawSettings } from '../utils/config.js';
import { createLogger } from './logger.js';

const logger = createLogger('api/core/config.js');

class ConfigurationManager {
    constructor() {
        this._config = null;
        this._overrides = {};
    }

    /**
     * Initialize and merge configurations.
     */
    async init() {
        if (this._config) return this._config;

        try {
            const raw = await getRawSettings();

            // Merge defaults with raw settings
            this._config = {
                agent: {
                    llm: {
                        baseUrl: 'http://localhost:11434',
                        model: 'qwen2.5:7b',
                        temperature: 0.7,
                        maxTokens: 2048,
                        contextLength: 4096,
                        timeoutMs: 120000,
                        useVision: true,
                        serverType: 'ollama',
                        bypassHealthCheck: false,
                        ...(raw.agent?.llm || {})
                    },
                    runner: {
                        maxSteps: 20,
                        stepDelay: 2000,
                        adaptiveDelay: true, // Use network idle instead of static delay
                        ...(raw.agent?.runner || {})
                    }
                },
                timeouts: {
                    navigation: 30000,
                    element: 10000,
                    ...raw.timeouts
                },
                ...raw
            };
        } catch (e) {
            logger.warn('Failed to load raw settings, using defaults');
            this._config = this._getDefaults();
        }

        return this._config;
    }

    /**
     * Get a configuration value by dot-notation path (e.g., 'agent.llm.model')
     * @param {string} path 
     * @param {*} defaultValue 
     */
    get(path, defaultValue = undefined) {
        if (!this._config) {
            logger.warn('ConfigurationManager not initialized, returning default');
            return defaultValue;
        }

        // Apply temporary override if exists
        if (this._overrides[path] !== undefined) {
            return this._overrides[path];
        }

        const keys = path.split('.');
        let current = this._config;

        for (const key of keys) {
            if (current === null || current === undefined) {
                return defaultValue;
            }
            current = current[key];
        }

        return current !== undefined ? current : defaultValue;
    }

    /**
     * Temporary overrides for a specific run/persona.
     * @param {string} path 
     * @param {*} value 
     */
    setOverride(path, value) {
        this._overrides[path] = value;
    }

    /**
     * Clear all current overrides.
     */
    clearOverrides() {
        this._overrides = {};
    }

    /**
     * Get full materialized config
     */
    getFullConfig() {
        return this._config || this._getDefaults();
    }

    _getDefaults() {
        return {
            agent: {
                llm: {
                    baseUrl: 'http://localhost:11434',
                    model: 'qwen2.5:7b',
                    temperature: 0.7,
                    maxTokens: 2048,
                    contextLength: 4096,
                    timeoutMs: 120000,
                    useVision: true,
                    serverType: 'ollama',
                    bypassHealthCheck: false
                },
                runner: {
                    maxSteps: 20,
                    stepDelay: 2000,
                    adaptiveDelay: true
                }
            },
            timeouts: {
                navigation: 30000,
                element: 10000
            }
        };
    }
}

export const configManager = new ConfigurationManager();
export default configManager;

import { getPage, withPage, getEvents } from './context.js';
import { setAutoBanners, setMuteAudio } from './context-state.js';
import { setPersona, getPersona, getPersonaName } from '../behaviors/persona.js';
import { apply as applyPatch, check as patchCheck } from '../utils/patch.js';
import { injectSensors } from '../utils/sensors.js';
import { startFidgeting } from '../interactions/cursor.js';
import { loadBuiltinPlugins, getPluginManager } from './plugins/index.js';
import { withErrorHook } from './hooks.js';
import { fingerprintManager } from '../utils/fingerprint.js';

import { applyHumanizationPatch } from '../utils/browserPatch.js';

const patchedPages = new WeakSet();
const hookedContexts = new WeakSet();

function safeEmitError(error, context) {
    try {
        const events = getEvents();
        events.emitSafe('on:error', { context, error });
    } catch {
        // Fallback if context/events not available
        console.error(`[Init Error] ${context}:`, error);
    }
}

function installContextHooks(page, options) {
    try {
        const context = page?.context?.();
        if (!context || hookedContexts.has(context)) {
            return;
        }

        hookedContexts.add(context);

        context.on('page', (newPage) => {
            initPage(newPage, options).catch((e) => safeEmitError(e, 'auto-init-page'));
        });

        if (typeof page.on === 'function') {
            page.on('popup', (popupPage) => {
                initPage(popupPage, options).catch((e) => safeEmitError(e, 'auto-init-popup'));
            });
        }
    } catch (e) {
        safeEmitError(e, 'installContextHooks');
    }
}

export async function initPage(page, options = {}) {
    if (!page) return;

    // Process initialization within the safety of the page's async local storage context
    return withPage(page, async () => {
        return withErrorHook('initPage', async () => {
            const {
                persona,
                personaOverrides,
                patch = true,
                humanizationPatch = true,
                autoInitNewPages = true,
                colorScheme,
                lite = false,
                blockNotifications = false,
                blockDialogs = false,
                autoBanners = false,
                muteAudio = false,
                logger,
            } = options;

            // Preserve autoBanners and mute state in context
            setAutoBanners(autoBanners);
            setMuteAudio(muteAudio);

            if (colorScheme) {
                try {
                    await page.emulateMedia({ colorScheme });
                } catch (e) {
                    safeEmitError(e, 'emulateMedia');
                }
            }

            if (lite) {
                try {
                    await page.route('**/*', (route) => {
                        const type = route.request().resourceType();
                        // Block images, media, fonts, and stylesheets to save max RAM/bandwidth
                        // preserved: script, xhr, fetch, ping, beacon (natural analytics)
                        if (['image', 'media', 'font', 'stylesheet', 'texttrack', 'manifest'].includes(type)) {
                            route.abort().catch((e) => safeEmitError(e, 'lite-route-abort'));
                        } else {
                            route.continue().catch((e) => safeEmitError(e, 'lite-route-continue'));
                        }
                    });
                    if (logger) logger.info('Ultra-Lite mode enabled: media and styles blocked (analytics preserved)');
                } catch (e) {
                    safeEmitError(e, 'lite-mode-route');
                }
            }

            if (blockNotifications) {
                try {
                    const context = page.context();
                    await context.grantPermissions([], { origin: page.url().split('/').slice(0, 3).join('/') }).catch((e) => safeEmitError(e, 'grantPermissions'));
                } catch (e) {
                    safeEmitError(e, 'blockNotifications');
                }
            }

            if (blockDialogs) {
                page.on('dialog', async (dialog) => {
                    if (logger) logger.debug(`[Dialog] Automatically dismissing ${dialog.type()}: ${dialog.message()}`);
                    await dialog.dismiss().catch((e) => safeEmitError(e, 'dialogDismiss'));
                });
            }

            if (muteAudio) {
                try {
                    await page.setMuted(true).catch((e) => safeEmitError(e, 'setMuted'));
                    if (logger) logger.info('Audio muted');
                } catch (e) {
                    safeEmitError(e, 'muteAudio');
                }
            }

            // Load plugins for this context
            loadBuiltinPlugins();
            try {
                getPluginManager().evaluateUrl(page.url());
            } catch (_e) { }

            if (persona) {
                setPersona(persona, personaOverrides || {});
            } else if (personaOverrides && Object.keys(personaOverrides).length > 0) {
                setPersona(getPersonaName(), personaOverrides);
            }

            if (!patch && !humanizationPatch) {
                return;
            }

            if (patchedPages.has(page)) {
                return;
            }

            if (autoInitNewPages) {
                installContextHooks(page, options);
            }

            if (patch) {
                let fp = options.fingerprint;
                if (!fp) {
                    try {
                        const ua = await page.evaluate(() => navigator.userAgent).catch(() => null);
                        fp = fingerprintManager.matchUserAgent(ua);
                    } catch (_e) {
                        fp = fingerprintManager.getRandom();
                    }
                }
                await applyPatch(fp);
            }

            if (humanizationPatch) {
                await applyHumanizationPatch(page, logger);
                await injectSensors();
                startFidgeting();
            }


            patchedPages.add(page);
        });
    });
}

export async function diagnosePage(page) {
    const p = page || getPage();

    return withPage(p, async () => {
        let patchStatus = null;
        try {
            patchStatus = await patchCheck();
        } catch (e) {
            safeEmitError(e, 'patchCheck');
        }

        let url = null;
        try {
            url = typeof p?.url === 'function' ? p.url() : null;
        } catch (e) {
            safeEmitError(e, 'diagnosePage-url');
        }

        return {
            url,
            personaName: getPersonaName(),
            persona: getPersona(),
            patch: patchStatus,
            patched: !!(p && patchedPages.has(p)),
        };
    });
}

/**
 * @fileoverview Base Plugin Class
 * Standard interface for all Auto-AI plugins.
 * @module api/plugins/base
 */

export class BasePlugin {
    /**
     * @param {string} name - Unique plugin name
     * @param {string} version - Semantic version
     */
    constructor(name, version = '1.0.0') {
        if (!name) throw new Error('Plugin must have a name');
        this.name = name;
        this.version = version;
        this.context = null; // Will be set by manager
        this.enabled = false;
    }

    /**
     * Lifecycle: Called when plugin is registered
     * @param {object} context - API Context
     */
    async onLoad(context) {
        this.context = context;
    }

    /**
     * Lifecycle: Called when plugin is enabled
     */
    async onEnable() {
        this.enabled = true;
    }

    /**
     * Lifecycle: Called when plugin is disabled
     */
    async onDisable() {
        this.enabled = false;
    }

    /**
     * Lifecycle: Called when plugin is unregistered
     */
    async onUnload() {
        this.context = null;
    }

    /**
     * Determines if the plugin should be enabled for the given URL
     * @param {string} url - Current page URL
     * @returns {boolean}
     */
    matches(url) {
        return true; // Default: active on all URLs
    }

    /**
     * Return map of hook handlers
     * @returns {Object.<string, Function>}
     */
    getHooks() {
        return {};
    }
}

/**
 * @fileoverview High-Level Kinetic Actions
 * Each action auto-invokes scroll.focus() ΓåÆ cursor move ΓåÆ execute.
 * All behaviors are persona-aware.
 * 
 * @module api/actions
 */

import { getPage, getCursor, isSessionActive, getEvents } from '../core/context.js';
import { setPreviousUrl } from '../core/context-state.js';
import { randomInRange } from '../behaviors/timing.js';
import { focus } from './scroll.js';
import { wait } from './wait.js';
import { getPersona } from '../behaviors/persona.js';
import { createLogger } from '../core/logger.js';
import { mathUtils } from '../utils/math.js';
import { getLocator, stringify } from '../utils/locator.js';
import { createPipeline, retryMiddleware, recoveryMiddleware } from '../core/middleware.js';
import { ElementObscuredError } from '../core/errors.js';

const logger = createLogger('api/actions.js');

function safeEmitWarning(context, error) {
    try {
        const events = getEvents();
        events.emitSafe('on:error', { context, error, level: 'warning' });
    } catch {
        logger.debug(`[Warning] ${context}:`, error);
    }
}

async function waitForStableBox(locator, options = {}) {
    const {
        timeoutMs = 2000,
        stableChecks = 3,
        intervalMs = 100,
        movementThreshold = 2,
    } = options;

    const start = Date.now();
    let prev = null;
    let stable = 0;

    while (Date.now() - start < timeoutMs) {
        if (!isSessionActive()) {
            throw new Error('SessionDisconnectedError: Browser closed during stability check.');
        }
        const box = await locator.boundingBox().catch(() => null);
        if (!box) {
            await wait(intervalMs);
            continue;
        }

        if (prev) {
            const delta = Math.abs(box.x - prev.x) + Math.abs(box.y - prev.y);
            if (delta <= movementThreshold) {
                stable += 1;
                if (stable >= stableChecks) {
                    return box;
                }
            } else {
                stable = 0;
            }
        }

        prev = box;
        await wait(intervalMs);
    }

    return prev;
}



/**
 * Checks if an element is obscured by another element.
 */
async function isObscured(locator) {
    return await locator.evaluate((el) => {
        const rect = el.getBoundingClientRect();
        const cx = rect.left + rect.width / 2;
        const cy = rect.top + rect.height / 2;
        const elementAtPoint = document.elementFromPoint(cx, cy);
        if (!elementAtPoint) return false;
        return !el.contains(elementAtPoint) && !elementAtPoint.contains(el);
    }).catch(() => false);
}

/**
 * Human-like click on a DOM element.
 * 2-Step Movement: scroll ΓåÆ move cursor ΓåÆ click
 * @param {string|import('playwright').Locator} selector - CSS selector or Locator to click
 * @param {object} [options]
 * @param {boolean} [options.recovery=true] - Automatic recovery on failure
 * @param {number} [options.maxRetries=3] - Max retry attempts
 * @param {boolean} [options.hoverBeforeClick=false] - Hover with drift before clicking
 * @param {string} [options.precision='normal'] - 'normal' or 'high'
 * @param {string} [options.button='left'] - Mouse button
 * @returns {Promise<{success: boolean, usedFallback: boolean}>}
 */
export async function click(selector, options = {}) {
    const page = getPage();
    setPreviousUrl(page.url());

    const {
        recovery = true,
        maxRetries = 3,
        timeoutMs = 5000,
        ensureStable = true,
        hoverBeforeClick = false,
        precision = 'normal',
        button = 'left',
    } = options;

    try {
        const pipeline = createPipeline(
            retryMiddleware({ maxRetries: recovery ? maxRetries : 0 }),
            recoveryMiddleware()
        );

        return await pipeline(async () => {
            const _page = getPage();
            const cursor = getCursor();
            const persona = getPersona();

            // STEP 1: Scroll to Golden View
            await focus(selector, { timeout: 5000 }).catch((e) => safeEmitWarning('click:focus', e));
            await wait(randomInRange(200, 800));

            // STEP 2: Pre-click stability & Visibility
            const locator = getLocator(selector).first();
            if (ensureStable) {
                await waitForStableBox(locator, { timeoutMs: 2000 }).catch(() => null);
            }

            // Ghost 3.0: Visual-Semantic Guard (Obstruction check)
            if (!options.force && await isObscured(locator)) {
                throw new ElementObscuredError(`Element "${stringify(selector)}" appears obscured.`);
            }

            // STEP 3: Move cursor
            try {
                if (typeof selector === 'string') {
                    await cursor.move(selector);
                } else {
                    // If it's a locator, we move to its box
                    const box = await locator.boundingBox();
                    if (box) {
                        await cursor.move(box.x + box.width / 2, box.y + box.height / 2);
                    }
                }
            } catch (e) {
                safeEmitWarning('click:cursor-move', e);
            }
            await wait(mathUtils.randomInRange(100, 400));

            // STEP 4: Kinetic Action
            const result = await cursor.click(locator, {
                allowNativeFallback: true,
                hoverBeforeClick,
                hoverMinMs: persona.hoverMin,
                hoverMaxMs: persona.hoverMax,
                precision,
                button,
            });

            await wait(mathUtils.randomInRange(200, 600)); // Post-click observation
            return result;
        }, { action: 'click', selector, options });
    } catch (e) {
        console.error('CRITICAL ERROR in api.click:', e);
        if (e.message && e.message.includes('SessionDisconnectedError')) {
            console.error('DEBUG INFO:', {
                isClosed: getPage().isClosed(),
                isConnected: getPage().context().browser()?.isConnected(),
                stack: e.stack
            });
        }
        throw e;
    }
}


/**
 * Human-like typing into a DOM element.
 * Scrolls to Golden View, focuses element, types character-by-character
 * with persona-driven typo injection and correction.
 * @param {string|import('playwright').Locator} selector - CSS selector or Locator of the input/textarea
 * @param {string} text - Text to type
 * @param {object} [options]
 * @param {number} [options.typoRate] - Override persona typo rate
 * @param {number} [options.correctionRate] - Override persona correction rate
 * @param {boolean} [options.clearFirst=false] - Clear field before typing
 * @param {number} [options.timeoutMs=5000] - Timeout for waiting for element to be attached
 * @param {boolean} [options.recovery=true] - Automatic recovery on failure
 * @returns {Promise<void>}
 */
export async function type(selector, text, options = {}) {
    const { recovery = true, timeoutMs = 5000 } = options;

    const pipeline = createPipeline(
        retryMiddleware({ maxRetries: recovery ? 2 : 0 }),
        recoveryMiddleware()
    );

    return await pipeline(async () => {
        const page = getPage();
        const persona = getPersona();
        const {
            typoRate = persona.typoRate,
            correctionRate = persona.correctionRate,
            clearFirst = false,
        } = options;

        // Golden View: scroll + cursor to element
        await focus(selector).catch((e) => safeEmitWarning('type:focus', e));

        const locator = getLocator(selector).first();
        // waitForSelector only works with strings, so we use locator.waitFor
        await locator.waitFor({ state: 'attached', timeout: 3000 }).catch((e) => safeEmitWarning('type:waitFor', e));
        await waitForStableBox(locator, { timeoutMs: 2000 }).catch(() => null);

        // Ghost 3.0: Visual-Semantic Guard
        if (!options.force && await isObscured(locator)) {
            throw new ElementObscuredError(`Input "${stringify(selector)}" appears obscured.`);
        }

        // Focus the element
        await locator.click({ timeout: 3000 }).catch((e) => safeEmitWarning('type:click', e));

        // Clear if requested
        if (clearFirst) {
            const isMac = process.platform === 'darwin';
            const modifier = isMac ? 'Meta' : 'Control';
            await page.keyboard.press(`${modifier}+A`);
            await page.keyboard.press('Backspace');
            await wait(mathUtils.randomInRange(100, 300));
        }

        // Type character by character with humanization
        const baseDelay = Math.round(100 / persona.speed); // ms per character

        for (let i = 0; i < text.length; i++) {
            const char = text[i];

            // Typo injection
            if (mathUtils.roll(typoRate)) {
                // Type wrong character
                const wrongChar = _getAdjacentKey(char);
                await page.keyboard.type(wrongChar, { delay: 0 });
                await wait(mathUtils.randomInRange(50, 200));

                // Maybe correct the typo
                if (mathUtils.roll(correctionRate)) {
                    await page.keyboard.press('Backspace');
                    await wait(mathUtils.randomInRange(80, 250));
                    await page.keyboard.type(char, { delay: 0 });
                }
            } else {
                await page.keyboard.type(char, { delay: 0 });
            }

            // Inter-character delay with Gaussian distribution
            let charDelay = mathUtils.gaussian(baseDelay, baseDelay * 0.3, 30, baseDelay * 3);

            // Punctuation pause
            if ('.!?,;:'.includes(char)) {
                charDelay += mathUtils.randomInRange(100, 300);
            }

            // Hesitation (persona-driven)
            if (mathUtils.roll(persona.hesitation * 0.5)) {
                charDelay += mathUtils.randomInRange(200, persona.hesitationDelay);
            }

            await wait(charDelay);
        }
    }, { action: 'type', selector, options });
}

/**
 * Human-like hover on a DOM element.
 * Scrolls to Golden View, moves cursor, and drifts.
 * @param {string|import('playwright').Locator} selector - CSS selector or Locator to hover
 * @param {object} [options]
 * @param {number} [options.duration] - Override hover duration
 * @param {boolean} [options.recovery=true] - Automatic recovery on failure
 * @returns {Promise<void>}
 */
export async function hover(selector, options = {}) {
    const { recovery = true, timeoutMs = 5000 } = options;

    const pipeline = createPipeline(
        retryMiddleware({ maxRetries: recovery ? 2 : 0 }),
        recoveryMiddleware()
    );

    return await pipeline(async () => {
        const _page = getPage();
        const cursor = getCursor();
        const persona = getPersona();

        await focus(selector).catch((e) => safeEmitWarning('hover:focus', e));

        const locator = getLocator(selector).first();
        const box = await locator.boundingBox();
        if (!box) throw new Error(`Target not found for hover: ${stringify(selector)}`);

        const targetX = mathUtils.gaussian(box.x + box.width / 2, box.width / 6);
        const targetY = mathUtils.gaussian(box.y + box.height / 2, box.height / 6);

        const hoverDuration = options.duration || mathUtils.randomInRange(persona.hoverMin, persona.hoverMax);
        await cursor.hoverWithDrift(targetX, targetY, hoverDuration, hoverDuration + 200);
    }, { action: 'hover', selector, options });
}


/**
 * Right-click on a DOM element.
 * @param {string|import('playwright').Locator} selector - CSS selector or Locator
 * @param {object} [options] - Same as click() options
 * @returns {Promise<{success: boolean, usedFallback: boolean}>}
 */
export async function rightClick(selector, options = {}) {
    return click(selector, { ...options, button: 'right' });
}

